swaptrade_modal_desc_crosschain_valuedif:
الرسوم التي تؤخذ في الاعتبار في فرق القيمة لمعاملة الجسر هي:
• رسوم الجسر العابر للشبكات: {bridgePriceAndFee}
• رسوم الشبكة على الشبكة الوجهة: {toChainPriceAndFee}

عند تداولك لمبلغ معين من العملات الرمزية، يؤثر ذلك على عمق مجمع السيولة. ويؤدي هذا بدوره إلى تغيير التوافر العام للعملات الرمزية وأسعارها؛ وهو ما يؤدي إلى اختلافات جوهرية في الأسعار.

swaptrade_mid_dialog_desc_est_network_fe:
في معاملات الجسر، تتضمن هذه الرسوم رسوم الشبكة لكل من شبكة المصدر والجسر العابر للشبكات.

تتكون رسوم هذه المعاملة من:
· رسوم شبكة ‏{chain}: {value1}
· رسوم شبكة الجسر {bridge}: {value2}

لا نفرض رسوم شبكة لأنها تُعَد مدفوعات للمُعَدِّنين.

swaptrade_intro_dialog_desc_cross_value_:
يظهر فرق قيمة هذه المعاملة على النحو التالي:
· {chain} رسوم الشبكة: {value1}
· {bridge} رسوم الجسر: {value2}

إذا كان فرق القيمة أكبر بكثير، بينما تكون الرسوم المدرجة أعلاه قليلة نسبيًا، يرجع ذلك إلى أن مبلغ الجسر قد أثر على عمق مجمع السيولة لهذا الزوج من العملات الرمزية.

swaptrade_intro_tooltip_trade_including_:
في معاملات الجسر، تتضمن التكلفة رسوم الشبكة الخاصة بشبكة الدفع وجزءًا من رسوم الجسر العابر للشبكات. تقسيم رسوم هذه المعاملة:
• رسوم الشبكة: {fromChainPriceAndFee}
• رسوم الجسر العابر للشبكات: {bridgePriceAndFee}
تغطي رسوم الشبكة تكاليف المُعدِّن ولا يتم تحصيلها بواسطة منصتنا.
